import React from 'react';

const burgerToggle = () => {
    let linksEl = '.narrowLinks';
    if (linksEl.style.display === 'block') {
        linksEl.style.display = 'none';
    } else {
        linksEl.style.display = 'block';
    }
  };


const NavComponent = () => {
return (
<nav className="nav-wrapper">
    <div className="navWide container">
        <div className="container">
            <a className="brand-logo" href="/" >Home</a>
            <ul className="right"><a href="/asksend" onClick={burgerToggle}>Ask Send</a>
            <li><a href="/instructions" onClick={burgerToggle}>Instructions</a></li>
            <li><a href="#" onClick={burgerToggle}>Link 4</a></li>
            <li><a href="#" onClick={burgerToggle}>Link 5</a></li>
            <li><a href="#" onClick={burgerToggle}>Link 6</a></li>
            </ul>
        </div>
    </div>
    <div className="navNarrow">
        <i className="fa fa-bars fa-2x"></i>
        <div className="narrowLinks">
            <a href="#" onClick={burgerToggle}>Link 1</a>
            <a href="#" onClick={burgerToggle}>Link 2</a>
            <a href="#" onClick={burgerToggle}>Link 3</a>
        </div>
    </div>
</nav>
);

};

export default NavComponent;
